import App from '../../layouts/App';
import Button from 'react-bootstrap/Button';
import useAuth from '../../context/hooks/useAuth';
import DatePicker from 'react-datepicker'
import 'react-datepicker/dist/react-datepicker.css'
import Axios from "axios";

import {Formik, Form, Field, ErrorMessage} from "formik";
import { useState } from 'react';

export default function Compromisso() {
    const red = useAuth().callRegister;
    const [selectedDate, setSelectedDate] = useState(null);
    if(!localStorage.getItem('token')){
        return (
            <App>
                <div class="container bg-light">
                    <div class="col-md-12 text-center">
                        
                            <h1>Você precisa de uma conta</h1>
                            <h2>Faça login</h2>
                        
                    </div>
                </div>
            </App>
        )
    }else{
        return(
            <App>
                <div class="container bg-light">
                    <div class="col-md-12 text-center">
                        
                        <div>
                            <h1>Cadastro</h1>
                            <Formik
                            initialValues={{}}
                            // onSubmit={}
                            // validationSchema={}
                            >
                                <Form className="login-form">
                                    <div className="login-form-group">
                                        <Field name="email" ClassName="form-field" placeholder="Titulo" />
                                        <ErrorMessage
                                        component="span"
                                        name="email"
                                        ClassName="form-error"
                                        />
                                    </div>

                                    <div className="login-form-group">
                                        <Field name="password" ClassName="form-field" placeholder="Detalhes" type="textarea" />
                                        <ErrorMessage
                                        component="span"
                                        name="password"
                                        ClassName="form-error"
                                        />
                                    </div>

                                    <div ClassName="login-form-group">
                                        <DatePicker selected={selectedDate} onChange={ date => setSelectedDate(date)} />
                                    </div>

                                    <div ClassName="login-form-group">
                                        <Field name="Confirmpassword" ClassName="form-field" placeholder="Confirmar senha" />
                                        <ErrorMessage
                                        component="span"
                                        name="Confirmpassword"
                                        ClassName="form-error"
                                        />
                                    </div>
                                    <Button variant="primary" ClassName="button" type="submit">Registrar</Button>
                                </Form>
                            </Formik>
                            {/*  */}
                        </div>
                        
                    </div>
                </div>
            </App>
        )
    }
}
